    hy: "Որո՞նք են ձեր հեռախոսի ապրանքանիշը (օրինակ՝ Apple կամ Samsung), մոդելի անվանումը (օրինակ՝ iPhone 12 կամ Galaxy A54) և մոդելի համարը (օրինակ՝ A2111 կամ SM-A505F): Տարբեր ապրանքանիշներ դա տարբեր կերպ են վարվում, ուստի ահա ձեր հեռախոսի հրահանգները.",
    bg: "Каква е марката на вашия телефон (напр. Apple или Samsung), името на модела (напр. iPhone 12 или Galaxy A54) и номерът на модела (напр. A2111 или SM-A505F)? Различните марки се справят с това по различен начин, така че ето инструкции за вашия телефон:",
