    cs: "Jaká je značka vašeho telefonu (např. Apple nebo Samsung), název modelu (např. iPhone 12 nebo Galaxy A54) a číslo modelu (např. A2111 nebo SM-A505F)? Různé značky to řeší odlišně, takže zde jsou pokyny pro váš telefon:",
