    nl: "Wat zijn het merk van uw telefoon (bijvoorbeeld Apple of Samsung), de modelnaam (bijvoorbeeld iPhone 12 of Galaxy A54) en het modelnummer (bijvoorbeeld A2111 of SM-A505F)? Verschillende merken gaan hier anders mee om, dus hier volgen instructies voor je telefoon:",
