    ko: "❌ 잘못된 답변입니다. 모델 이름은 “iPhone ”으로 시작해야 하며 숨겨진 \"<spantranslate='no'>A</span>\" 번호는 \"<spantranslate='no'>A</span>\" 뒤에 4-가 와야 합니다. 숫자.",
