    pl: "❌ NIELEGALNA ODPOWIEDŹ. Nazwa modelu musi zaczynać się od „iPhone”, a ukryty numer „<span Translation='no'>A</span>” musi mieć postać „<span Translation='no'>A</span>”, po którym następuje cztero- cyfra.",
