    ru: "❌НЕЗАКОННЫЙ ОТВЕТ. Название модели должно начинаться с «iPhone», а скрытый номер «<span Translate='no'>A</span>» должен быть «<span Translate='no'>A</span>», за которым следует четверка. цифровое число.",
    sr: "❌ НЕЗАКОНИТИ ОДГОВОР. Назив модела мора да почиње „иПхоне“, а скривени „<спан транслате='но'>А</спан>“ број мора да буде „<спан транслате='но'>А</спан>“, а затим следи четири- дигитални број.",
    su: '❌ JAWABAN HARAM. Ngaran Model kedah dimimitian "iPhone", sareng "<span translate=\'no\'>A</span>" Nomer disumputkeun kedah "<span translate=\'no\'>A</span>" dituturkeun ku opat- angka angka.',
