    sv: '❌ OLAGLIGT SVAR. Modellnamnet måste börja "iPhone ", och det dolda "<span translate=\'no\'>A</span>"-numret måste vara "<span translate=\'no\'>A</span>" följt av en fyra- siffror.',
    tr: "❌ YASA DIŞI CEVAP. Model Adı “iPhone” ile başlamalı ve Gizli \"<spantranslate='no'>A</span>\" Numarası \"<spantranslate='no'>A</span>\" ve ardından dörtlü bir harf gelmelidir. dijital numara.",
    ur: '❌ غیر قانونی جواب۔ ماڈل کا نام "iPhone" شروع ہونا چاہیے، اور پوشیدہ "<span translate=\'no\'>A</span>" نمبر ہونا چاہیے "<span translate=\'no\'>A</span>" اس کے بعد چار- ہندسوں کا نمبر',
    it: '❌ RISPOSTA ILLEGALE. Il nome del modello deve iniziare con "iPhone" e il numero nascosto "<span Translate=\'no\'>A</span>" deve essere "<span Translate=\'no\'>A</span>" seguito da un quattro- digita il numero.',
