    is: "FIREFOX. Farðu í Stillingar > Um símann (áður „Um tæki“). Afritaðu heiti líkans og númer í samsvarandi reiti hér að neðan.",
    id: 'FIREFOX. Buka Pengaturan > Tentang ponsel (sebelumnya "Tentang perangkat"). Salin Nama dan nomor model ke kolom terkait di bawah.',
    ja: "ファイアフォックス。 [設定] > [電話情報] (以前の「デバイス情報」) に移動します。モデル名と番号を以下の対応するフィールドにコピーします。",
    kn: 'ಫೈರ್ಫಾಕ್ಸ್. ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಫೋನ್ ಕುರಿತು (ಹಿಂದೆ "ಸಾಧನದ ಕುರಿತು") ಗೆ ಹೋಗಿ. ಕೆಳಗಿನ ಅನುಗುಣವಾದ ಕ್ಷೇತ್ರಗಳಿಗೆ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆಯನ್ನು ನಕಲಿಸಿ.',
    ko: "파이어폭스. 설정 > 휴대전화 정보(이전의 '기기 정보')로 이동하세요. 모델 이름과 번호를 아래 해당 필드에 복사하세요.",
    lt: "FIREFOX. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Nukopijuokite modelio pavadinimą ir numerį į atitinkamus toliau pateiktus laukus.",
    ms: 'FIREFOX. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Salin nama dan nombor Model ke medan yang sepadan di bawah.',
