    tl: 'APPLE iPad. Pumunta sa Mga Setting > Pangkalahatan > Tungkol. Kopyahin ang "Pangalan ng Modelo" sa field sa ibaba. Pagkatapos ay i-tap ang "Numero ng Modelo" para ipakita ang nakatagong "A" na numero: isang "A" na sinusundan ng apat na digit. I-type iyon sa field sa ibaba.',
