    hy: "APPLE iPad. Գնացեք Կարգավորումներ > Ընդհանուր > Մասին: Պատճենեք «Մոդելի անունը» ստորև նշված դաշտում: Այնուհետև կտտացրեք «Մոդելի համարը»՝ թաքնված «A» համարը բացահայտելու համար՝ «A»-ն, որին հաջորդում է չորս նիշ: Մուտքագրեք այն ստորև նշված դաշտում:",
    bg: "APPLE iPad. Отидете в Settings > General > About. Копирайте „Името на модела“ в полето по-долу. След това докоснете „Номер на модела“, за да разкриете скрития номер „А“: „А“, последван от четири цифри. Въведете това в полето по-долу.",
    "zh-CN":
      "苹果iPad。前往“设置”>“常规”>“关于”。将“型号名称”复制到下面的字段。然后点击“型号”以显示隐藏的“A”编号：“A”后跟四位数字。将其输入下面的字段中。",
    "zh-HK":
      "蘋果iPad。前往“設定”>“常規”>“關於”。將“型號名稱”複製到下面的欄位。然後點選「型號」以顯示隱藏的「A」編號：「A」後面跟著四位數字。將其輸入下面的欄位中。",
