    cs: 'iPad APPLE. Přejděte do Nastavení > Obecné > O aplikaci. Zkopírujte "Název modelu" do pole níže. Poté klepněte na „Číslo modelu“, abyste odhalili skryté číslo „A“: „A“ následované čtyřmi číslicemi. Napište to do pole níže.',
