    nl: 'APPLE iPad. Ga naar Instellingen > Algemeen > Info. Kopieer de "Modelnaam" naar het onderstaande veld. Tik vervolgens op het "Modelnummer" om het verborgen "A"-nummer te onthullen: een "A" gevolgd door vier cijfers. Typ dat in het onderstaande veld.',
