    fi: '❌ Valitettavasti MMM NNN USB-mikrofoni, sarja-SSS, ei ole vielä profiilikirjastossa. Napsauta Jatka kokeillaksesi toista mikrofonia. Tai paina "Palaa tarpeet-sivulle".',
    fr: "❌ Désolé, le microphone USB MMM NNN, série SSS, n'est pas encore dans la bibliothèque de profils. Appuyez sur Continuer pour essayer un autre microphone. Ou cliquez sur « Retour à la page des besoins ».",
    de: "❌ Leider ist das MMM NNN USB-Mikrofon, serielles SSS, noch nicht in der Profilbibliothek. Klicken Sie auf „Weiter“, um ein anderes Mikrofon auszuprobieren. Oder klicken Sie auf „Zurück zur Bedarfsseite“.",
    el: '❌ Λυπούμαστε, το μικρόφωνο MMM NNN USB, σειριακό SSS, δεν βρίσκεται ακόμα στη βιβλιοθήκη προφίλ. Πατήστε Συνέχεια για να δοκιμάσετε άλλο μικρόφωνο. Ή πατήστε "Επιστροφή στη σελίδα των αναγκών".',
    he: '❌ מצטערים, המיקרופון MMM NNN USB, SSS טורי, עדיין לא נמצא בספריית הפרופילים. לחץ על המשך כדי לנסות מיקרופון אחר. או לחץ על "חזור לדף הצרכים".',
    hi: '❌ क्षमा करें, एमएमएम एनएनएन यूएसबी माइक्रोफोन, सीरियल एसएसएस, अभी तक प्रोफ़ाइल लाइब्रेरी में नहीं है। दूसरा माइक्रोफ़ोन आज़माने के लिए आगे बढ़ें दबाएँ। या "रिटर्न टू नीड्स पेज" पर क्लिक करें।',
    hu: '❌ Sajnáljuk, az MMM NNN USB-mikrofon, soros SSS, még nincs a profilkönyvtárban. Nyomja meg a Folytatás gombot egy másik mikrofon kipróbálásához. Vagy kattintson a "Vissza a szükségletek oldalára" gombra.',
    is: '❌ Því miður, MMM NNN USB hljóðneminn, serial SSS, er ekki enn á prófílsafninu. Smelltu á Halda áfram til að prófa annan hljóðnema. Eða smelltu á "Fara aftur á þarfasíðu".',
    id: '❌ Maaf, mikrofon USB MMM NNN, serial SSS, belum ada di perpustakaan profil. Tekan Lanjutkan untuk mencoba mikrofon lain. Atau tekan "Kembali ke Halaman Kebutuhan".',
    ja: "❌ 申し訳ありませんが、MMM NNN USB マイク、シリアル SSS はまだプロファイル ライブラリにありません。 [続行] をクリックして別のマイクを試します。または、「ニーズページに戻る」をクリックします。",
    kn: '❌ ಕ್ಷಮಿಸಿ, MMM NNN USB ಮೈಕ್ರೊಫೋನ್, ಸರಣಿ SSS, ಇನ್ನೂ ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಯಲ್ಲಿಲ್ಲ. ಮತ್ತೊಂದು ಮೈಕ್ರೊಫೋನ್ ಪ್ರಯತ್ನಿಸಲು ಮುಂದುವರೆಯಿರಿ ಒತ್ತಿರಿ. ಅಥವಾ "ನೀಡ್ಸ್ ಪುಟಕ್ಕೆ ಹಿಂತಿರುಗಿ" ಒತ್ತಿರಿ.',
    ko: '❌ 죄송합니다. MMM NNN USB 마이크, 직렬 SSS가 아직 프로필 라이브러리에 없습니다. 진행을 눌러 다른 마이크를 사용해 보세요. 또는 "필요 사항 페이지로 돌아가기"를 누르십시오.',
    lt: "❌ Atsiprašome, MMM NNN USB mikrofono, serijinio SSS, dar nėra profilių bibliotekoje. Norėdami išbandyti kitą mikrofoną, paspauskite Tęsti. Arba paspauskite „Grįžti į poreikių puslapį“.",
    ms: '❌ Maaf, mikrofon USB MMM NNN, SSS bersiri, belum lagi berada dalam pustaka profil. Tekan Teruskan untuk mencuba mikrofon lain. Atau tekan "Kembali ke Halaman Keperluan".',
    no: '❌ Beklager, MMM NNN USB-mikrofonen, seriell SSS, er ennå ikke i profilbiblioteket. Trykk på Fortsett for å prøve en annen mikrofon. Eller trykk "Gå tilbake til behovsside".',
    fa: '❌ متأسفیم، میکروفون USB MMM NNN، سریال SSS، هنوز در کتابخانه نمایه نیست. برای امتحان یک میکروفون دیگر، روی Proce ضربه بزنید. یا "بازگشت به صفحه نیاز" را بزنید.',
    pl: "❌ Przepraszamy, mikrofon USB MMM NNN, serial SSS, nie znajduje się jeszcze w bibliotece profili. Naciśnij przycisk Kontynuuj, aby wypróbować inny mikrofon. Lub naciśnij „Powrót do strony potrzeb”.",
    pt: '❌ Desculpe, o microfone USB MMM NNN, serial SSS, ainda não está na biblioteca de perfis. Clique em Continuar para tentar outro microfone. Ou clique em "Retornar à página de necessidades".',
    ro: "❌ Ne pare rău, microfonul USB MMM NNN, serial SSS, nu se află încă în biblioteca de profil. Apăsați Continuați pentru a încerca un alt microfon. Sau apăsați „Reveniți la pagina de nevoi”.",
    ru: "❌К сожалению, USB-микрофона МММ ННН, серийный SSS, пока нет в библиотеке профиля. Нажмите «Продолжить», чтобы попробовать другой микрофон. Или нажмите «Вернуться на страницу потребностей».",
    sr: "❌ Жао нам је, МММ ННН УСБ микрофон, серијски ССС, још увек није у библиотеци профила. Притисните Настави да испробате други микрофон. Или притисните „Повратак на страницу са потребама“.",
    su: '❌ Punten, mikropon USB MMM NNN, serial SSS, teu acan aya dina perpustakaan profil. Pencét Teruskeun pikeun nyobaan mikropon anu sanés. Atanapi pencét "Balik deui ka Halaman Peryogikeun".',
