    ur: '❌ معذرت، MMM NNN USB مائکروفون، سیریل SSS، ابھی تک پروفائل لائبریری میں نہیں ہے۔ دوسرا مائکروفون آزمانے کے لیے آگے بڑھیں کو دبائیں۔ یا "Return to Needs Page" کو دبائیں۔',
