    hi: '❌ क्षमा करें, MMM NNN, xxx, अभी तक प्रोफ़ाइल लाइब्रेरी में शामिल नहीं है। दूसरा माइक्रोफ़ोन आज़माने के लिए आगे बढ़ें दबाएँ। या "रिटर्न टू नीड्स पेज" पर क्लिक करें।',
