    kn: '❌ ಕ್ಷಮಿಸಿ, MMM NNN, xxx, ಇನ್ನೂ ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಯಲ್ಲಿ ಸೇರಿಸಲಾಗಿಲ್ಲ. ಮತ್ತೊಂದು ಮೈಕ್ರೊಫೋನ್ ಪ್ರಯತ್ನಿಸಲು ಮುಂದುವರೆಯಿರಿ ಒತ್ತಿರಿ. ಅಥವಾ "ನೀಡ್ಸ್ ಪುಟಕ್ಕೆ ಹಿಂತಿರುಗಿ" ಒತ್ತಿರಿ.',
