    hy: "ՄԱՍՆԱԿՑԵԼՈՒ ՀԱՄԱՐ, ուղղեք ձեր հեռախոսի տեսախցիկը ստորև նշված QR կոդի վրա և հպեք ձեր հեռախոսի էկրանին երևացող հղմանը:",
    bg: "ЗА УЧАСТИЕ, насочете камерата на телефона си към QR кода по-долу и докоснете връзката, която се появява на дисплея на телефона ви.",
    "zh-CN":
      "要参与，请将手机的摄像头对准下面的二维码，然后点击手机显示屏上显示的链接。",
