    de: "Um teilzunehmen, richten Sie die Kamera Ihres Telefons auf den QR-Code unten und tippen Sie auf den Link, der auf dem Display Ihres Telefons angezeigt wird.",
    el: "ΓΙΑ ΝΑ ΣΥΜΜΕΤΕΧΕΤΕ, στρέψτε την κάμερα του τηλεφώνου σας στον παρακάτω κωδικό QR και πατήστε τον σύνδεσμο που εμφανίζεται στην οθόνη του τηλεφώνου σας.",
    he: "כדי להשתתף, כוון את מצלמת הטלפון שלך אל קוד ה-QR למטה והקש על הקישור שמופיע בצג הטלפון שלך.",
    hi: "भाग लेने के लिए, अपने फ़ोन के कैमरे को नीचे दिए गए QR कोड पर इंगित करें, और अपने फ़ोन के डिस्प्ले पर दिखाई देने वाले लिंक पर टैप करें।",
    hu: "A RÉSZVÉTELHEZ irányítsa telefonja kameráját az alábbi QR-kódra, és koppintson a telefon kijelzőjén megjelenő hivatkozásra.",
    is: "Til að taka þátt skaltu beina myndavél símans að QR kóðanum hér að neðan og smella á tengilinn sem birtist á skjá símans.",
