    kn: "ಭಾಗವಹಿಸಲು, ಕೆಳಗಿನ QR ಕೋಡ್‌ನಲ್ಲಿ ನಿಮ್ಮ ಫೋನ್‌ನ ಕ್ಯಾಮರಾವನ್ನು ಪಾಯಿಂಟ್ ಮಾಡಿ ಮತ್ತು ನಿಮ್ಮ ಫೋನ್‌ನ ಡಿಸ್‌ಪ್ಲೇಯಲ್ಲಿ ಗೋಚರಿಸುವ ಲಿಂಕ್ ಅನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ.",
    ko: "참여하려면 휴대폰 카메라를 아래 QR 코드에 대고 휴대폰 디스플레이에 나타나는 링크를 탭하세요.",
    lt: "NORĖDAMI DALYVAUTI, nukreipkite savo telefono kamerą į toliau pateiktą QR kodą ir bakstelėkite telefono ekrane rodomą nuorodą.",
    ms: "UNTUK MENYERTAI, halakan kamera telefon anda pada kod QR di bawah, dan ketik pautan yang muncul dalam paparan telefon anda.",
    no: "FOR Å DELTA, pek telefonens kamera mot QR-koden nedenfor, og trykk på koblingen som vises på telefonens display.",
    fa: "برای شرکت، دوربین تلفن خود را به سمت کد QR زیر بگیرید و روی پیوندی که در صفحه نمایش تلفنتان ظاهر می‌شود ضربه بزنید.",
    pl: "ABY UCZESTNICZYĆ, skieruj aparat swojego telefonu na poniższy kod QR i kliknij link, który pojawi się na wyświetlaczu telefonu.",
    pt: "PARA PARTICIPAR, aponte a câmera do seu celular para o código QR abaixo e toque no link que aparece no display do seu celular.",
    ro: "PENTRU A PARTICIPA, îndreptați camera telefonului către codul QR de mai jos și atingeți linkul care apare pe afișajul telefonului.",
    ru: "ДЛЯ УЧАСТИЯ наведите камеру своего телефона на приведенный ниже QR-код и коснитесь ссылки, которая появится на дисплее вашего телефона.",
    sr: "ДА БИСТЕ УЧЕСТВОВАЛИ, усмерите камеру свог телефона на КР код испод и додирните везу која се појављује на екрану вашег телефона.",
    su: "Pikeun milu, arahkeun kaméra telepon anjeun ka kode QR di handap, teras ketok tautan anu muncul dina tampilan telepon anjeun.",
    sw: "ILI KUSHIRIKI, elekeza kamera ya simu yako kwenye msimbo wa QR ulio hapa chini, na uguse kiungo kinachoonekana kwenye onyesho la simu yako.",
    sv: "FÖR ATT DELTA, rikta telefonens kamera mot QR-koden nedan och tryck på länken som visas på telefonens display.",
    tr: "KATILMAK İÇİN telefonunuzun kamerasını aşağıdaki QR koduna doğrultun ve telefonunuzun ekranında görünen bağlantıya dokunun.",
    ur: "حصہ لینے کے لیے، اپنے فون کے کیمرہ کو نیچے دیئے گئے QR کوڈ پر رکھیں، اور آپ کے فون کے ڈسپلے میں ظاہر ہونے والے لنک کو تھپتھپائیں۔",
    it: "PER PARTECIPARE, punta la fotocamera del tuo telefono sul codice QR sottostante e tocca il collegamento che appare sul display del tuo telefono.",
