    es: "Para una verificación rápida de la comunicación, apunte la cámara de su teléfono al código QR a continuación y toque el enlace que aparece en la pantalla de su teléfono.",
    ml: "ദ്രുത ആശയവിനിമയ പരിശോധനയ്ക്കായി, നിങ്ങളുടെ ഫോണിൻ്റെ ക്യാമറ ചുവടെയുള്ള QR കോഡിലേക്ക് പോയിൻ്റ് ചെയ്‌ത് നിങ്ങളുടെ ഫോണിൻ്റെ സ്‌ക്രീനിൽ ദൃശ്യമാകുന്ന ലിങ്കിൽ ടാപ്പ് ചെയ്യുക.",
    tl: "Para sa mabilis na pagsusuri sa komunikasyon, ituro ang camera ng iyong telepono sa QR code sa ibaba at i-tap ang link na lalabas sa screen ng iyong telepono.",
