    ml: "1. ചുവടെയുള്ള ബോക്സിൽ, സ്മാർട്ട്ഫോണിൻ്റെ അല്ലെങ്കിൽ USB മൈക്രോഫോണിൻ്റെ നിർമ്മാണവും മോഡലും ടൈപ്പ് ചെയ്യുക, ഉദാ. Apple iPhone 12 Pro.\n",
    tl: "1. Sa kahon sa ibaba, i-type ang gawa at modelo ng smartphone o USB microphone, hal. Apple iPhone 12 Pro.\n",
    ar: "1. في المربع أدناه، اكتب نوع وطراز الهاتف الذكي أو ميكروفون USB، على سبيل المثال. ابل ايفون 12 برو.\n",
    hy: "1. Ներքևի վանդակում մուտքագրեք սմարթֆոնի կամ USB խոսափողի մակնիշը և մոդելը, օրինակ. Apple iPhone 12 Pro.\n",
