    "zh-HK":
      "1. 在下面的方塊中，輸入智慧型手機或 USB 麥克風的品牌和型號，例如蘋果 iPhone 12 Pro。\n",
    hr: "1. U donji okvir upišite marku i model pametnog telefona ili USB mikrofona, npr. Apple iPhone 12 Pro.\n",
    cs: "1. Do pole níže zadejte značku a model smartphonu nebo USB mikrofonu, např. Apple iPhone 12 Pro.\n",
    da: "1. I boksen nedenfor skal du indtaste fabrikat og model for smartphonen eller USB-mikrofonen, f.eks. Apple iPhone 12 Pro.\n",
    nl: "1. Typ in het onderstaande vak het merk en model van de smartphone of USB-microfoon, bijvoorbeeld: Apple iPhone 12 Pro.\n",
