    fa: "سلام xxx. هر نمایه‌ای که در کتابخانه نمایه مشارکت می‌کنید، با ایمیل xxx شما مهر می‌خورد تا مشارکت شما را اعتبار بخشد.",
    pl: "Witaj xxx. Każdy profil, który dodasz do biblioteki profili, zostanie ostemplowany Twoim adresem e-mail xxx, aby zasilić Twój wkład.",
    pt: "Olá xxx. Cada perfil com o qual você contribui para a biblioteca de perfis será carimbado com seu e-mail xxx, para creditar sua contribuição.",
    ro: "Bună ziua xxx. Fiecare profil cu care contribuiți la biblioteca de profil va fi ștampilat cu e-mailul dvs. xxx, pentru a vă credita contribuția.",
    ru: "Привет, ХХХ. На каждом профиле, который вы добавляете в библиотеку профилей, будет указан ваш адрес электронной почты xxx в знак признания вашего вклада.",
    sr: "Здраво КСКСКС. Сваки профил који унесете у библиотеку профила биће обележен вашом е-поштом КСКСКС, како би се приписао допринос.",
    su: "Halo xxx. Unggal profil anu anjeun sumbangkeun ka perpustakaan profil bakal dicap ku email anjeun xxx, pikeun ngémutan kontribusi anjeun.",
    sw: "Habari xxx. Kila wasifu unaochangia kwenye maktaba ya wasifu utawekwa mhuri wa barua pepe yako xxx, ili kuthamini mchango wako.",
    sv: "Hej xxx. Varje profil som du bidrar med till profilbiblioteket kommer att stämplas med din e-postadress xxx, för att kreditera ditt bidrag.",
    tr: "Merhaba xxx. Profil kitaplığına katkıda bulunduğunuz her profil, katkınızın kredilendirilmesi amacıyla xxx e-postanız ile damgalanacaktır.",
    ur: "ہیلو xxx۔ آپ کی پروفائل لائبریری میں تعاون کرنے والے ہر پروفائل پر آپ کے تعاون کو کریڈٹ کرنے کے لیے آپ کے ای میل xxx کے ساتھ مہر لگا دی جائے گی۔",
