    cs: "❌ Promiň! Tento xxx není v knihovně profilů, takže jej nelze použít ke kalibraci. Pokud máte jiný telefon, který byste chtěli vyzkoušet, namiřte jeho fotoaparát na QR kód a klepněte na odkaz, který se zobrazí na jeho obrazovce.",
