    hi: "❌ क्षमा करें! यह xxx प्रोफ़ाइल लाइब्रेरी में नहीं है, इसलिए इसका उपयोग अंशांकन के लिए नहीं किया जा सकता. यदि आपके पास कोई अन्य फ़ोन है जिसे आप आज़माना चाहते हैं, तो बस उसके कैमरे को QR कोड पर इंगित करें और उसकी स्क्रीन पर दिखाई देने वाले लिंक पर टैप करें।",
    hu: "❌ Elnézést! Ez a xxx nincs a profilkönyvtárban, ezért nem használható kalibrálásra. Ha van másik telefonja, amelyet ki szeretne próbálni, csak irányítsa a kameráját a QR-kódra, és koppintson a képernyőn megjelenő hivatkozásra.",
    is: "❌ Því miður! Þessi xxx er ekki í prófílsafninu, svo það er ekki hægt að nota það til að kvarða. Ef þú ert með annan síma sem þú vilt prófa skaltu bara beina myndavélinni að QR kóðanum og smella á tengilinn sem birtist á skjánum hans.",
    id: "❌ Maaf! xxx ini tidak ada di perpustakaan profil, sehingga tidak dapat digunakan untuk kalibrasi. Jika Anda mempunyai ponsel lain yang ingin Anda coba, cukup arahkan kameranya ke kode QR dan ketuk tautan yang muncul di layarnya.",
    ja: "❌ ごめんなさい！この xxx はプロファイル ライブラリにないため、調整に使用できません。試してみたい別の携帯電話がある場合は、そのカメラを QR コードに向けて、画面に表示されるリンクをタップします。",
    kn: "❌ ಕ್ಷಮಿಸಿ! ಈ xxx ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಯಲ್ಲಿಲ್ಲ, ಆದ್ದರಿಂದ ಇದನ್ನು ಮಾಪನಾಂಕ ನಿರ್ಣಯಿಸಲು ಬಳಸಲಾಗುವುದಿಲ್ಲ. ನೀವು ಪ್ರಯತ್ನಿಸಲು ಬಯಸುವ ಇನ್ನೊಂದು ಫೋನ್ ಅನ್ನು ನೀವು ಹೊಂದಿದ್ದರೆ, ಅದರ ಕ್ಯಾಮರಾವನ್ನು QR ಕೋಡ್‌ಗೆ ಪಾಯಿಂಟ್ ಮಾಡಿ ಮತ್ತು ಅದರ ಪರದೆಯಲ್ಲಿ ಗೋಚರಿಸುವ ಲಿಂಕ್ ಅನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ.",
    ko: "❌ 미안해요! 이 xxx는 프로필 라이브러리에 없으므로 보정에 사용할 수 없습니다. 사용해보고 싶은 다른 휴대전화가 있다면 카메라로 QR 코드를 가리키고 화면에 나타나는 링크를 탭하세요.",
    lt: "❌ Atsiprašau! Šio xxx nėra profilių bibliotekoje, todėl jo negalima naudoti kalibruojant. Jei turite kitą telefoną, kurį norėtumėte išbandyti, tiesiog nukreipkite jo kamerą į QR kodą ir bakstelėkite ekrane rodomą nuorodą.",
    ms: "❌ Maaf! xxx ini tiada dalam pustaka profil, jadi ia tidak boleh digunakan untuk menentukur. Jika anda mempunyai telefon lain yang ingin anda cuba, hanya halakan kameranya pada kod QR dan ketik pautan yang muncul dalam skrinnya.",
    no: "❌ Beklager! Denne xxx er ikke i profilbiblioteket, så den kan ikke brukes til å kalibrere. Hvis du har en annen telefon du vil prøve, retter du kameraet mot QR-koden og trykker på koblingen som vises på skjermen.",
