    ml: "കഥാ സമയം! ഒരു പുസ്തകത്തിൽ നിന്ന് 111 പേജുകൾ നിങ്ങൾ വായിക്കും. നിങ്ങൾ ആരംഭിച്ചുകഴിഞ്ഞാൽ, അവസാനം എത്തുന്നതുവരെ, പൂർണ്ണമായ ഗ്രാഹ്യം നിലനിർത്തിക്കൊണ്ട്, കഴിയുന്നത്ര വേഗത്തിൽ എല്ലാ പേജുകളും നിശബ്ദമായി വായിക്കുക. അപ്പോൾ ഞങ്ങൾ നിങ്ങളോട് കഥയെക്കുറിച്ച് കുറച്ച് ചോദ്യങ്ങൾ ചോദിക്കും. ഓരോ പേജിലും, അടുത്ത പേജിനായി SPACE ബാർ അമർത്തുക. നിങ്ങൾ തയ്യാറാകുമ്പോൾ, SPACE അമർത്തുക.",
    tl: "Oras ng kwentuhan! Magbabasa ka ng 111 na pahina mula sa isang libro. Sa sandaling magsimula ka, mangyaring tahimik na basahin ang lahat ng mga pahina nang mabilis hangga't maaari, habang pinapanatili ang buong pag-unawa, hanggang sa maabot mo ang dulo. Pagkatapos ay tatanungin ka namin ng ilang mga katanungan tungkol sa kuwento. Sa bawat pahina, pindutin ang SPACE bar para sa susunod na pahina. Kapag handa ka na, pindutin ang SPACE.",
    ar: "وقت القصة! ستقرأ 111 صفحة من الكتاب. بمجرد البدء، يرجى قراءة جميع الصفحات بصمت بأسرع ما يمكن، مع الحفاظ على الفهم الكامل، حتى تصل إلى النهاية. ثم سنطرح عليك بعض الأسئلة حول القصة. في كل صفحة، اضغط على شريط المسافة للصفحة التالية. عندما تكون جاهزًا، اضغط على SPACE.",
    hy: "Պատմության ժամանակ! Դուք կկարդաք գրքից 111 էջ: Երբ սկսեք, խնդրում ենք լուռ կարդացեք բոլոր էջերը որքան կարող եք արագ՝ պահպանելով ամբողջական ըմբռնումը, մինչև հասնեք ավարտին: Այնուհետև մենք ձեզ մի քանի հարց կտանք պատմության վերաբերյալ: Յուրաքանչյուր էջում սեղմեք SPACE սանդղակը հաջորդ էջի համար: Երբ պատրաստ լինեք, սեղմեք SPACE:",
    bg: "Време за история! Ще прочетете 111 страници от книга. След като започнете, моля, прочетете мълчаливо всички страници възможно най-бързо, като същевременно поддържате пълно разбиране, докато стигнете до края. След това ще ви зададем няколко въпроса за историята. На всяка страница натискайте ИНТЕРВАЛ за следващата страница. Когато сте готови, натиснете SPACE.",
