    kn: "ಕೆಲವು ಪದಗಳನ್ನು ಓದಲು ಸಿದ್ಧರಿದ್ದೀರಾ? ಅಡ್ಡ ಕೂದಲಿನ ಮಧ್ಯದಲ್ಲಿ ನೇರವಾಗಿ ನೋಡುತ್ತಿರುವಾಗ, ದಯವಿಟ್ಟು SPACE ಬಾರ್ ಅನ್ನು ಒತ್ತಿರಿ.",
    ko: "단어를 읽을 준비가 되셨나요? 십자선 중앙을 똑바로 바라보면서 SPACE 바를 눌러주세요.",
